import { StyleSheet } from "react-native";

export default StyleSheet.create({
  topBar: {
    alignSelf: "stretch",
    height: 52,
    flexDirection: "row", // row
    backgroundColor: "#161616",
    alignItems: "center",
    justifyContent: "center", // center, space-around
    paddingLeft: 10,
    paddingRight: 10,
  },
  topBarText: {
    color: "white",
  },
});
